package arithmetic_operators;

public class ExchangeOfValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n, n2, aux;
		n = 35;
		n2= 20;
		aux=n;
		n=n2;
		n2=aux;
		System.out.println("n final value is: " + n);
		System.out.println("n2 final value is: " + n2);
	}

}
